"use strict";

class Curves
{
	constructor()
	{
		this.hasCanvas = false;
		this.canvas = null;
		this.ctx = null; 
		this.w = 300;
		this.h = 300;
		this.svg = null;
		this.ns = "http://www.w3.org/2000/svg";
		this._title = $(document).find("title").text();

		this.txt =  $("*[title='Enter your name here']");
		this.selOne = null;
		this.selTwo = null;
	}

	test(){console.log("Curves.class");}

	loadSvg()
	{
		try
		{
			this.canvas = $("canvas").get(0);
			this.ctx = this.canvas.getContext("2d");

			var msg = new Item().svg();
			var parser = new DOMParser();

			this.svg = parser.parseFromString(msg,"image/svg+xml");
			this.drawSvg(this.svg);   

			console.log("SVG Loaded at: " + this._title);
		}
		catch(e)
		{
			console.log("loadSvg: " + e);
		}
	}
	
	getInput()
	{
		try
		{
			this.txt = $("*[title='Enter your name here']");
		}
		catch(e)
		{
			console.log("getInput: " + e)
		}
	}
	
	getSelAccent()
	{
		try
		{
			let tgt = $('select').toArray();
			this.selOne =  $(tgt).eq(1);
			//console.log("accent: " + $(tgt)[2].options[1].text);
		}
		catch(e)
		{
			console.log("getAccent" + e);
		}
	}
	
	accentSelector(selAccent)
	{
		try
		{
			var accent = {0:"#",1:"#dia",2:"#ajan",3:"#afeb",4:"#amar",5:"#aapr",6:"#amay",7:"#ajun",8:"#ajul",9:"#aaug",10:"#asep",11:"#aoct",12:"#anov",13:"#adec"};
			
			let _target = this.svg.getElementsByTagName("use")[1];
			$(_target).attr("xlink:href",accent[selAccent]);
			
		}
		catch(e)
		{
			console.log("alloyColor: " + e);
		}
	}
	
	getSelAlloy()
	{
		try
		{       
			let tgt = $('select').toArray();
			$.each(tgt, (index)=> 
			{
				 if($(tgt)[index].options[1].text === "Silver")
				 {
					this.selTwo =  $(tgt)[index];
				}	
			});
		}
		catch(e)
		{
		console.log("getAlloy: " + e);
		}
	}
	
	alloyColor(selTwo)
	{
		try
		{
			var alloy = {0:"#silver",1:"#silver", 2:"#yellow", 3:"#rose", 4:"#silver"};
			var alloyFill = {0:"#A9A9A9",1:"#A9A9A9",2:"#c69f68",3:"#D4938B",4:"#A9A9A9"};
			let _target = this.svg.getElementsByTagName("use")[0];
			let _targetTxt = this.svg.getElementsByTagName("textPath")[0]
			
			$(_target).attr("xlink:href",alloy[selTwo]);
			$(_targetTxt).attr("fill",alloyFill[selTwo]);
		}
		catch(e)
		{
			console.log("alloyColor: " + e);
		}
	}
	
	clsCanvas()
	{
		try
		{
			this.canvas = $("#canvas").get(0);
			this.ctx = this.canvas.getContext("2d");
			this.ctx.clearRect(0, 0, this.w, this.h);
		}
		catch(e)
		{
			console.log(e);
		}	
	}
	
	resetCanvas()
	{
		if($(this.txt).val() === "")
		{
			this.clsCanvas();
		}
	}
	
	textFactory(svgDoc, inputName, selectAccent)
	{
		try 
		{
			let _a, _b;


			if(inputName === 'Enteryournamehere')
			{
				return;
			}    
			else
			{
				_a = inputName;
			}

			var _target = svgDoc.getElementsByTagName("textPath")[0];
			_target.textContent = "";

			var _prefix;
			_prefix = document.createElementNS(this.ns,"tspan");

			_prefix.textContent = _a;

			_target.appendChild(_prefix);
		} 
		catch (e) 
		{
			console.log("textFactory: " + e);
		}
	}
	
	drawSvg(svgDoc)
	{
		try 
		{
			var serializer = new XMLSerializer();
			var svgString = serializer.serializeToString(svgDoc);

			var img = new Image();
			img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

			img.onload = ()=> 
			{
				this.clsCanvas();
				this.ctx.drawImage(img, 0, 0, this.w, this.h);
			};
		} 
		catch(e) 
		{
			console.log("drawSvg: "+e);
		}
	}
	
	scaleCanvas()
	{
		$("#canvas")
		.mouseenter(()=>
		{
			try 
			{
				
				var serializer = new XMLSerializer();
				var svgString = serializer.serializeToString(this.svg);

				var img = new Image();
				img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

				img.onload = ()=> 
				{
					this.clsCanvas();
					this.ctx.drawImage(img, -30, -30, this.w*1.2, this.h*1.2);
				};
			} 
			catch(e) 
			{
				console.log("scaleCanvas: "+e);
			}
		})
		.mouseout(()=>
		{
			try 
			{
				
				var serializer = new XMLSerializer();
				var svgString = serializer.serializeToString(this.svg);

				var img = new Image();
				img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

				img.onload = ()=> 
				{
					this.clsCanvas();
					this.ctx.drawImage(img,0 , 0, this.w, this.h);
				};
			} 
			catch(e) 
			{
				console.log("scaleCanvas: " + e);
			}
		})
		.click(()=>
		{
			this.justifyText();
			var serializer = new XMLSerializer();
				var svgString = serializer.serializeToString(this.svg);

				var img = new Image();
				img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

				img.onload = ()=> 
				{
					this.clsCanvas();
					this.ctx.drawImage(img, -30, -30, this.w*1.2, this.h*1.2);
				};
		})
		;
	}
	
	justifyText()
	{
		try 
		{
			var pos = {start:"middle",middle:"end",end:"start"};
			var posOffset = {start:"0%",middle:"50%",end:"88%"};
			let _target = this.svg.getElementsByTagName("textPath")[0];
			$(_target).attr("text-anchor",pos[$(_target).attr("text-anchor")])
			.attr("startOffset",posOffset[$(_target)
			.attr("text-anchor")]);
		} 
		catch(e) 
		{
			console.log("scaleCanvas: " + e);
		}
	}
	
	interactivity()
	{
		try
		{
			this.getInput();
			this.getSelAlloy();
			this.getSelAccent();

			this.resetCanvas();
			//update text
			this.textFactory(this.svg, $(this.txt).val(), null);
			//update alloy
			this.alloyColor($(this.selTwo).prop("selectedIndex"));
			//update accent
			this.accentSelector($(this.selOne).prop("selectedIndex"));
			//paint canvas
			this.drawSvg(this.svg);
			
		}
		catch(e)
		{
			console.log("interactivity: " + e);
		}
	}

	render()
	{           
		$(document)
		.on("keyup",$(this.txt),(evt)=>
		{
			try 
			{
				this.interactivity();
			} 
			catch (e) 
			{
			console.log("render: " + e);
			}
		})
		.bind("change",$(this.selOne),(evt)=> 
		{
			try 
			{
				this.interactivity();
			} 
			catch (e) 
			{
				console.log("render: " + e);
			}
		});
	}

	init()
	{
		if($("#canvas").length > 0)
		{
			this.loadSvg();
			this.render();
			this.scaleCanvas();
		}
		else
		{
		console.log("No Canvas Found/Contact product.js vendor");
		}
	}
} 

